import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faJava, 
  faHtml5, 
  faCss3, 
  faJs, 
  faNodeJs, 
  faReact,
  faGit 
} from '@fortawesome/free-brands-svg-icons';
import { faC, faCpp } from '@fortawesome/free-solid-svg-icons';

export default function Technology() {

  const languages = [
    { name: "Java", icon: faJava },
    { name: "C", icon: faC },
    { name: "C++", icon: faCpp },
    { name: "HTML", icon: faHtml5 },
    { name: "CSS", icon: faCss3 },
    { name: "JavaScript", icon: faJs },
  ];

  const frontend = [
    { name: "React.js", icon: faReact },
    // Replace the following with the correct icons
    { name: "DaisyUI", icon: faReact }, 
  ];

  const backend = [
    { name: "Node.js", icon: faNodeJs },
    { name: "Express.js", icon: faNodeJs}, 
    { name: "MongoDB", icon: faNodeJs }, 
  ];

  const tools = [
    { name: "Git", icon: faGit }, 
  ];

  return (
    <div className="bg-base-100 about py-20 px-36 flex flex-col items-center">
      {/* Title */}
      <h1 className="text-5xl font-bold p-2 mb-10 bg-primary rounded-lg inline-block">Technologies</h1>

      {/* Two columns layout */}
      <div className="grid grid-cols-2 gap-8 w-full">
        {/* Technologies column */}
        <div>
          <h2 className='text-left text-2xl font-bold pb-1 pt-2'>Languages</h2>
          <div className="grid grid-cols-3">
            {languages.map((tech, index) => (
              <div key={index} className="flex items-center justify-left p-3 bg-primary rounded-lg inline-block mb-2 mr-2">
                <FontAwesomeIcon icon={tech.icon} size="2x" className="text-white" />
                <p className="ml-2 text-white">{tech.name}</p>
              </div>
            ))}
          </div>

          <h2 className='text-left text-2xl font-bold pb-1 pt-2'>Frontend</h2>
          <div className="grid grid-cols-3">
            {frontend.map((tech, index) => (
              <div key={index} className="flex items-center justify-left p-3 bg-primary rounded-lg inline-block mb-2 mr-2">
                <FontAwesomeIcon icon={tech.icon} size="2x" className="text-white" />
                <p className="ml-2 text-white">{tech.name}</p>
              </div>
            ))}
          </div>

          <h2 className='text-left text-2xl font-bold pb-1 pt-2'>Backend</h2>
          <div className="grid grid-cols-3">
            {backend.map((tech, index) => (
              <div key={index} className="flex items-center justify-left p-3 bg-primary rounded-lg inline-block mb-2 mr-2">
                <FontAwesomeIcon icon={tech.icon} size="2x" className="text-white" />
                <p className="ml-2 text-white">{tech.name}</p>
              </div>
            ))}
          </div>

          <h2 className='text-left text-2xl font-bold pb-1 pt-2'>Tools</h2>
          <div className="grid grid-cols-3">
            {tools.map((tech, index) => (
              <div key={index} className="flex items-center justify-left p-3 bg-primary rounded-lg inline-block mb-2 mr-2">
                <FontAwesomeIcon icon={tech.icon} size="2x" className="text-white" />
                <p className="ml-2 text-white">{tech.name}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Code mockup column */}
        <div className="mockup-code rounded-tr-none rounded-br-none bg-primary text-primary-content ps-10 pb-5 pe-10 w-auto"> 
  <pre data-prefix="$"><code>./aboutMe</code></pre> 
  <br />
  <pre className=""><code>Name: Amy Nguyen</code></pre>
  <br />
  <pre className=""><code>Age: 21</code></pre>
  <br />
  <pre className=""><code>School: University of Georgia</code></pre>
  <br />
  <pre className=""><code>Hometown: Lilburn, GA</code></pre>


</div>
</div>
</div>
);
}
